function App() {
    const blogOjbArr = [{
      title: 'Test',
      desc: 'Testtestetst'
    },
    {
      title: 'Test1',
      desc: 'Testtestetst'
    },
    {
      title: 'Test2',
      desc: 'Testtestetst'
    }]

    const blogCard = blogOjbArr.map((item, pos)=>{
      return(
        <BlogCard />
      )
    });
  return (
    <div className="App">
      <div className="lenovoBackground">
        {blogCard}
      </div>
    </div>
  );
}

export default App;
